-- ----------------------------
-- Table structure for ms_read
-- ----------------------------
DROP TABLE IF EXISTS `ms_read`;
CREATE TABLE `ms_read` (
  `user_id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '阅读人ID',
  `message_id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '消息ID',
  `state` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '阅读状态 Yes已读 No未读',
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `update_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改人',
  `remark` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注',
  `delete_flag` varchar(10) COLLATE utf8mb4_bin DEFAULT 'Used' COMMENT 'used启用 disable禁用 delete删除',
  PRIMARY KEY (`user_id`,`message_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='消息阅读情况';

